import React from "react";
import UserUser from "../UserUser";
import "./Frame51.css";

function Frame51(props) {
  const { image2, userUserProps } = props;

  return (
    <div className="frame-51 border-1px-abbey">
      <img className="image-22" src={image2} />
      <div className="frame-2371">
        <div className="rectangle-103"></div>
        <UserUser userUser={userUserProps.userUser} className="basic-trashempty" />
      </div>
    </div>
  );
}

export default Frame51;
